import { ImageResponse } from 'next/og';
import { NextRequest } from 'next/server';
import { tools } from '@/tools';
// App router includes @vercel/og.
// No need to install it.

export const runtime = 'edge';
const bgImageBase64 = `data:image/jpeg;base64,`;
/**
 * 清理文本，移除链接和不支持的字符
 * 将 [text](url) 格式的链接转换为纯文本
 * 移除URL格式的链接
 */
function cleanText(text: string): string {
  if (!text) return '';

  // 清理 Markdown 格式的链接 [text](url)，只保留文本部分
  text = text.replace(/\[([^\]]+)\]\([^)]+\)/g, '$1');

  // 清理URL格式的链接
  text = text.replace(/(https?:\/\/[^\s]+)/g, '');

  // 移除多余空格
  text = text.replace(/\s+/g, ' ').trim();

  return text;
}

export async function GET(request: NextRequest) {
  try {
    const { searchParams } = new URL(request.url);
    const path = searchParams.get('path');

    // Default fallback content
    let title = 'ACG Sedai';
    let description = 'Insipred by anime-sedai';

    // Find tool by path if provided
    if (path) {
      const tool = tools.find((tool) => tool.path === path);
      if (tool) {
        title = tool.name;
        description = tool.description;

        // 清理description中的链接和不支持字符
        description = cleanText(description);
      }
    }

    return new ImageResponse(
      (
        <div
          style={{
            height: '100%',
            width: '100%',
            display: 'flex',
            flexDirection: 'column',
            alignItems: 'center',
            justifyContent: 'center',
            backgroundImage: `url("${bgImageBase64}")`,
            backgroundSize: 'cover',
            backgroundPosition: 'center',
            fontFamily: 'Inter, sans-serif',
            position: 'relative',
            overflow: 'hidden',
            backgroundColor: '#fdf0f5',
          }}
        >
          {/* 背景遮罩层 */}
          <div
            style={{
              position: 'absolute',
              top: 0,
              left: 0,
              right: 0,
              bottom: 0,
              background:
                'linear-gradient(135deg, rgba(255, 255, 255, 0.4) 0%, rgba(255, 255, 255, 0.2) 50%, rgba(255, 255, 255, 0.3) 100%)',
              zIndex: 0,
            }}
          />

          {/* 内容容器 - 替代毛玻璃效果 */}
          <div
            style={{
              display: 'flex',
              flexDirection: 'column',
              alignItems: 'center',
              justifyContent: 'center',
              textAlign: 'center',
              zIndex: 1,
              width: '85%',
              padding: '40px',
              // 使用多层背景和阴影来模拟毛玻璃效果
              background: 'linear-gradient(135deg, rgba(255, 255, 255, 0.9) 0%, rgba(255, 255, 255, 0.4) 100%)',
              borderRadius: '24px',
              boxShadow:
                '0 16px 60px rgba(0, 0, 0, 0.15), 0 8px 32px rgba(0, 0, 0, 0.1), inset 0 1px 0 rgba(255, 255, 255, 0.8)',
              border: '2px solid rgba(255, 255, 255, 0.6)',
            }}
          >
            {/* Title */}
            <div
              style={{
                fontSize: 96,
                fontWeight: 'bold',
                color: '#786172',
                lineHeight: 1.2,
                marginBottom: '30px',
                textAlign: 'center',
              }}
            >
              {title}
            </div>
            {/* Description */}
            <div
              style={{
                fontSize: 42,
                color: '#977992',
                lineHeight: 1.4,
                textAlign: 'center',
                maxWidth: '98%',
                fontWeight: '600',
              }}
            >
              {description}
            </div>
          </div>

          {/* 底部信息 - 改进样式 */}
          <div
            style={{
              position: 'absolute',
              bottom: '30px',
              display: 'flex',
              alignItems: 'center',
              fontSize: 32,
              color: '#ffffff',
              fontWeight: 'bold',
              background: 'linear-gradient(135deg, rgba(0, 0, 0, 0.4) 0%, rgba(0, 0, 0, 0.6) 100%)',
              padding: '12px 24px',
              borderRadius: '20px',
              border: '1px solid rgba(255, 255, 255, 0.3)',
              boxShadow: '0 4px 16px rgba(0, 0, 0, 0.2)',
              textShadow: '0 1px 2px rgba(0, 0, 0, 0.8)',
            }}
          >
            ACG Sedai
          </div>
        </div>
      ),
      {
        width: 1200,
        height: 630,
        headers: {
          'cache-control': 'public, immutable, no-transform, max-age=31536000',
          'content-type': 'image/png',
        },
      },
    );
  } catch (e: any) {
    console.log(`Failed to generate OG image: ${e.message}`);
    return new Response(`Failed to generate the image`, {
      status: 500,
    });
  }
}
